me desculpem ! Sei que vcs que acompanham o Meteoro são pessoas civilizadas e do bem mas não posso deixar de lembrar uma frase do Ricardo Boechat que fala nesse momento por mim ;

" O Malafaia , vai chupar uma rola vai ! "

É isso ! Obrigado a todos e desculpem a grosseria ! Mas me fez muito bem !
